const TableHeadings = () => {
    return (

        <thead className="tableHeader">
          <tr>
            <th scope="col"> Ranking </th>
            <th scope="col"> Player Name </th>
            <th scope="col"> Score </th>
          </tr>          
        </thead>

    );
}

export default TableHeadings;
